export default function Login() {
  return (
    <div>
      <h3>Login</h3>
      <div>
        <form>
          <input placeholder="Enter Username"></input>
          <input placeholder="Enter Password"></input>
          <button>Login</button>
        </form>
      </div>
    </div>
  );
}
